import {useEffect, useState} from 'react'
import axios from 'axios'

export default function getData(size, pageNumber) {
    
    useEffect(() => {
        axios({
            method: 'GET',
            url: 'https://api.instantwebtools.net/v1/passenger?page='+{pageNumber}+'&size='+{size}
        }).then(res => {
            console.log(res.data)
        })
    }, [size, pageNumber])
    return null
}
